Actionscript.script:
I = function (t) {
	tellTarget (t) {
		xspeed = Math.random()*8-4;
		yspeed = Math.random()*4-8;
		rotspeed = random(16)-8;
		count = 0;
	}
};
OEF = function (t) {
	tellTarget (t) {
		yspeed += 0.2;
		_y += yspeed;
		_x += xspeed;
		_rotation += rotspeed;
		if ((_y+(_height/2))>86) {
			yspeed *= -0.8;
			_y--;
			rotspeed = -rotspeed;
		}
		if ((_x+(_width/2))>177) {
			xspeed *= -0.9;
			_x--;
			rotspeed = -rotspeed;
		}
		if ((_x-(_width/2))<-210) {
			xspeed *= -0.9;
			_x++;
			rotspeed = -rotspeed;
		}
		//if (count++>300) {  
		count++;
		if ((count>50 && Math.abs(yspeed)<3) || count>200) {
			_alpha -= 2;
			if (_alpha<=0) {
				t.swapDepths(0);
				t.removeMovieClip();
			}
		}
	}
};
